import 'dart:async';
import 'dart:convert';
import 'dart:typed_data';

import 'package:flutter/material.dart';
import 'package:squadron/squadron.dart';

import '../_helpers/page_content.dart';
import '../logging_service.dart';
import 'thumbnail_service.dart';

class ThumbnailContent extends PageContent {
  ThumbnailContent() : super('SQUADRON SAMPLE - THUMBNAILS');

  List<Uint8List>? _images;
  List<Uint8List>? _thumbnails;

  Future _selectImage(SquadronPlatformType mode) async {
    // resetting UI
    if (_images != null) {
      _images = null;
      _thumbnails = null;
      refresh();
    }

    // have the user pick a set of images or take pictures
    // in this sample, automatically pick up 3 hardcoded images
    final images = [
      base64Decode(dartIcon),
      base64Decode(flutterIcon),
      base64Decode(squadronIcon),
    ];

    final concurrency =
        ConcurrencySettings(minWorkers: 1, maxWorkers: 4, maxParallel: 1);
    final pool = switch (getMode()) {
      SquadronPlatformType.js =>
        ThumbnailServiceWorkerPool.js(concurrencySettings: concurrency),
      SquadronPlatformType.wasm =>
        ThumbnailServiceWorkerPool.wasm(concurrencySettings: concurrency),
      SquadronPlatformType.unknown => ThumbnailService(),
      _ => ThumbnailServiceWorkerPool(concurrencySettings: concurrency)
    };
    if (pool is IWorker) await (pool as IWorker).start();

    try {
      // get the thumbnails from ThumbnailService via Squadron
      final thumbnails = <Uint8List>[];
      final futures = <Future<Uint8List>>[];
      for (var i = 0; i < images.length; i++) {
        futures.add(Future<Uint8List>(() async {
          mainLogger.log('[$threadId] [M] Loading image #$i...');
          final sw = Stopwatch()..start();
          final t = await pool.getThumbnail(images[i], 32, 32);
          mainLogger.log('[$threadId] [M] Image #$i loaded in ${sw.elapsed}');
          return t;
        }));
      }
      thumbnails.addAll(await Future.wait(futures));

      // do something with the thumbnails, eg. display on UI, send to a backend, write to a file or database...
      _images = images;
      _thumbnails = thumbnails;
    } finally {
      if (pool is IWorker) (pool as IWorker).stop();
    }
    refresh();
  }

  @override
  Widget body() {
    final labels = [
      'Dart',
      'Flutter',
      'Squadron',
    ];

    return Center(
        child: Column(mainAxisAlignment: MainAxisAlignment.center, children: [
      TextButton(
        onPressed: () => _selectImage(SquadronPlatformType.unknown),
        child: const Text('Select Image (main thread)'),
      ),
      TextButton(
        onPressed: () => _selectImage(getMode()),
        child: const Text('Select Image (pool)'),
      ),
      if (_images == null)
        Padding(
            padding: const EdgeInsets.all(4),
            child: Row(
                mainAxisAlignment: MainAxisAlignment.spaceEvenly,
                children: [Image.memory(base64Decode(pickIcon))])),
      if (_images != null)
        Padding(
            padding: const EdgeInsets.all(4),
            child: Row(
                mainAxisAlignment: MainAxisAlignment.spaceEvenly,
                children: _images!.indexed
                    .map((item) => Column(children: [
                          Text(labels[item.$1]),
                          Image.memory(item.$2),
                        ]))
                    .toList())),
      if (_thumbnails != null)
        Padding(
            padding: const EdgeInsets.all(8),
            child: Row(
                mainAxisAlignment: MainAxisAlignment.spaceEvenly,
                children: _thumbnails!.indexed
                    .map((item) => Column(children: [
                          Text('Thumbnail #${item.$1}'),
                          Image.memory(item.$2),
                        ]))
                    .toList())),
    ]));
  }

  @override
  List<Widget> actions() => [];
}

// hard-coded images
const pickIcon =
    '';

const flutterIcon =
    '';

const dartIcon =
    '';

const squadronIcon =
    '';
